import React, { useState, useEffect } from "react";
import { useParams, Link } from "react-router-dom";


const [session, setSession] = useState(false);



function SignInButton(){
  return <Link to="/users/sign_in" className="btn btn-text-dark mb-2">Sign in </Link>
}

function SignOutButton(){
  return <Link to="/users/sign_out" className="btn btn-text-dark mb-2">Sign in </Link>
}
function Home() {
  useEffect(() => {
  axios.get(`http://localhost:3000/users/details`, { headers: { Accept: "application/json" } })
      .then(response => {
         setSession(response.data.res)
      })
      .catch(error => alert(error))
}, []);
    return (
   <><Link to="/" className="btn btn-outline-dark mb-2">
                   Home
                 </Link>
                 {session ? <SignInButton/> : <SignOutButton/>}
                 </>


  );
}

export default Home;
